type LocalCityType ={
    title: string
    countryTitle: string
}
type AdressType= {
    streetTitle: string
    city:LocalCityType
}
type TechnologiesType = {
    id: number
    title: string
}
type StudentType = {
    id: number,
    name: string,
    age: number,
    isActive: boolean,
    address: AdressType
    technologies: TechnologiesType[]

}
export const student:StudentType = {
    id: 1,
    name: 'Danil',
    age: 27,
    isActive: true,
    address: {
        streetTitle: 'Surganova 2',
        city: {
            title: "Minsk",
            countryTitle: 'Belarus',
        }
    },
    technologies: [
        {
            id: 1,
            title: "HTML"
        },
        {
            id: 2,
            title: "CSS"
        },
        {
            id: 3,
            title: "JS"
        },

    ]
}

console.log(student.age)
console.log(student.name)
console.log(student.technologies[2].title)
